      <fieldset>
        <legend><i class="fa-solid fa-list"></i> 정렬</legend>
        <button>최신등록순</button>
        <button>D-day시간</button>
        <button>D-day</button>
      </fieldset>
      <fieldset>
        <legend><i class="fa-solid fa-magnifying-glass"></i> 검색</legend>
      </fieldset>
    </form>
  );
};

export default CompFilterForm;
